import React from 'react';
import './index.css';
import { Link, animateScroll as scroll } from 'react-scroll';

export default function Home() {
    return (
        <div>
            <div className='home-container'>
                <nav style={{ 
                    display: 'flex', 
                    position: 'absolute',
                    marginRight: '150px' }}>
                    <Link to='home' spy={true} smooth={true}>Home</Link>
                    <Link to='about' spy={true} smooth={true}>About Me</Link>
                    <Link to='languages' spy={true} smooth={true}>Languages</Link>
                    <Link to='portfolio' spy={true} smooth={true}>Portfolio</Link>
                    <Link to='resume' spy={true} smooth={true}>Resume</Link>
                </nav>
                <div style={{
                    display: 'flex',
                    position: 'relative',
                    fontSize: '40px',
                    fontWeight: 'bold',
                    justifyContent: 'center',
                    alignItems: 'center',
                    marginTop: '100px',
                    color: 'white'
                }}><h1>TAYLER RADCLIFFE</h1>
                    <h5 style={{ display: 'flex', position: 'absolute', marginTop: '250px' }}>Software Developer</h5>
                </div>

                <div class="container" style={{
                    position: 'absolute',
                    fontSize: '60px',
                    marginTop: '600px',
                    alignItems: 'center',
                    justifyContent: 'center'
                }}>
                    <div class="arrow" >
                    </div>
                    <div style={{
                        marginLeft: '-200px'
                    }} class="arrow" >
                    </div>
                    <div style={{
                        marginLeft: '150px'
                    }} class="arrow" >
                    </div>
                </div>
            </div>
        </div>

    )
}
